import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const VisitorDashboard = () => {
  const [reports, setReports] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simulate fetching reports
    setTimeout(() => {
      setReports([
        {
          id: 1,
          referenceId: 'CMP-20240115-ABC123',
          problemType: 'Litter',
          description: 'Garbage bin overflowing',
          status: 'Submitted',
          date: '2024-01-15'
        },
        {
          id: 2,
          referenceId: 'CMP-20240115-DEF456',
          problemType: 'Damaged Equipment',
          description: 'Broken swing',
          status: 'In Progress',
          date: '2024-01-15'
        }
      ]);
      setLoading(false);
    }, 1000);
  }, []);

  const getStatusBadge = (status) => {
    const colors = {
      'Submitted': 'warning',
      'In Progress': 'info',
      'Resolved': 'success'
    };
    return (
      <span className={`badge bg-${colors[status] || 'secondary'}`}>
        {status}
      </span>
    );
  };

  return (
    <div className="container mt-4">
      <h2>Your Dashboard</h2>
      <p>Track and manage your park reports</p>
      
      <div className="row">
        <div className="col-md-8">
          <div className="card mb-4">
            <div className="card-header bg-primary text-white">
              <h5 className="mb-0">Your Reports</h5>
            </div>
            <div className="card-body">
              {loading ? (
                <p>Loading reports...</p>
              ) : reports.length === 0 ? (
                <p>No reports submitted yet.</p>
              ) : (
                <div className="table-responsive">
                  <table className="table table-hover">
                    <thead>
                      <tr>
                        <th>Reference ID</th>
                        <th>Problem Type</th>
                        <th>Description</th>
                        <th>Status</th>
                        <th>Date</th>
                      </tr>
                    </thead>
                    <tbody>
                      {reports.map(report => (
                        <tr key={report.id}>
                          <td><code>{report.referenceId}</code></td>
                          <td>{report.problemType}</td>
                          <td>{report.description}</td>
                          <td>{getStatusBadge(report.status)}</td>
                          <td>{report.date}</td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              )}
            </div>
          </div>
        </div>
        
        <div className="col-md-4">
          <div className="card mb-4">
            <div className="card-header bg-info text-white">
              <h5 className="mb-0">Quick Actions</h5>
            </div>
            <div className="card-body">
              <Link to="/report" className="btn btn-primary w-100 mb-2">
                Submit New Report
              </Link>
              <Link to="/track" className="btn btn-outline-primary w-100 mb-2">
                Track Existing Report
              </Link>
              <button className="btn btn-outline-secondary w-100">
                View Park Guidelines
              </button>
            </div>
          </div>
          
          <div className="card">
            <div className="card-header bg-success text-white">
              <h5 className="mb-0">Stats</h5>
            </div>
            <div className="card-body">
              <p>Total Reports: {reports.length}</p>
              <p>Resolved: {reports.filter(r => r.status === 'Resolved').length}</p>
              <p>In Progress: {reports.filter(r => r.status === 'In Progress').length}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default VisitorDashboard;
